    function stm_footer_selection() {
        if (typeof stm_footer_terms !== 'undefined') {
            var substringMatcher = function(strs) {
                return function findMatches(q, cb) {
                    var matches, substringRegex;
                    matches = [];
                    var substrRegex = new RegExp(q, 'i');
                    $.each(strs, function(i, str) { if (substrRegex.test(str)) { matches.push(str); } });
                    cb(matches);
                };
            };
            var $input = $('.stm-listing-layout-footer .stm-footer-search-inventory input');
            var selectedValue = '';
            $input.typeahead({ hint: true, highlight: true, minLength: 1 }, { name: 'stm_footer_terms', source: substringMatcher(stm_footer_terms) });
            $input.typeahead('val', stm_default_search_value).trigger('keyup');
            $input.typeahead('close');
            $input.on('keydown', function() { selectedValue = $(this).val(); })
            $input.on('typeahead:select', function(ev, suggestion) { selectedValue = suggestion; });
            var enableSubmission = false;
            $('.stm-footer-search-inventory form').on('submit', function(e) {
                if (!enableSubmission) { e.preventDefault(); }
                var keyChosen = $.inArray(selectedValue, stm_footer_terms);
                if (keyChosen != -1) {
                    var slug = stm_footer_terms_slugs[keyChosen];
                    var taxonomy = stm_footer_taxes[keyChosen];
                    if (typeof(taxonomy) != 'undefined' && typeof(slug) != 'undefined' && !enableSubmission) {
                        $input.attr('name', taxonomy);
                        $input.val(slug);
                        enableSubmission = true;
                        $(this).trigger('submit');
                    }
                } else {
                    if (!enableSubmission) {
                        enableSubmission = true;
                        $(this).trigger('submit');
                    }
                }
            });
        }
    }
