function stm_sticky_service_header() {
    var currentScrollPos = $(window).scrollTop();
    var headerPos = $('#header').offset().top;
    if (currentScrollPos >= headerPos) { $('.header-service-fixed').addClass('header-service-sticky'); } else { $('.header-service-fixed').removeClass('header-service-sticky'); }
    if (sections) {
        hasVisible = false;
        sections.forEach(function(sectionObj) {
            if (currentScrollPos < sectionObj.height && (currentScrollPos + headerOffset + 1) > sectionObj.offset) {
                currentVisibleSection = sectionObj.id;
                $('.header-service .header-menu li').removeClass('active');
                $('a[href="' + sectionObj.id + '"]').closest('li').addClass('active');
                if (!hasVisible) { hasVisible = true; }
            }
        });
        if (!hasVisible) { $('.header-service .header-menu li').removeClass('active'); }
    }
}

function stm_getSections() {
    sections = [];
    $('.header-menu li').each(function() {
        var currentId = $(this).find('a').attr('href');
        if (currentId.charAt(0) == '#') {
            var currentIdOffset = $('div' + currentId).offset();
            if (typeof currentIdOffset != 'undefined') {
                currentIdOffset = currentIdOffset.top;
                var currenIdHeight = $('div' + currentId).outerHeight() + currentIdOffset;
                sections.push({ id: currentId, offset: currentIdOffset, height: currenIdHeight });
            }
        }
    });
}

function stm_listing_fixed_header() {
    if ($('.header-listing').hasClass('header-listing-fixed') || $('.header-magazine').hasClass('header-magazine-fixed') || $('.header-main-ev_dealer').hasClass('header-listing-fixed')) {
        var currentScrollPos = $(window).scrollTop();
        var headerPos = $('#header').offset().top;
        var $headerHeight = 0;
        if ($this.hasClass('listing-nontransparent-header')) { $('#header').css('min-height', $headerHeight = $this.outerHeight() + 'px'); }
        if (currentScrollPos > headerPos) { $this.addClass('stm-fixed-invisible-mobile'); } else { $this.removeClass('stm-fixed-invisible-mobile'); }
        if ($this.hasClass('stm-fixed-invisible-mobile')) {
            if (!isAbsolute) $('#header').attr('style', 'min-height: ' + $this.outerHeight() + 'px;');
            $this.addClass('stm-fixed-invisible');
        } else {
            $('#header').removeAttr('style');
            $this.removeClass('stm-fixed-invisible');
        }
        if ($this.hasClass('stm-fixed-invisible-mobile')) {
            var width = $("#main").width();
            var bg = $this.find(".header-inner-content").attr("data-bg");
            $this.addClass('stm-fixed');
            if ($(".stm-boxed").width() != null) {
                $this.find(".header-inner-content").attr("style", "background-color: " + bg + "; width: " + width + "px; max-width: " + width + "px;");
                $('#header').addClass('stm-header-was-fixed');
            }
        } else {
            $this.removeClass('stm-fixed');
            $('#header').removeClass('stm-header-was-fixed');
            $this.find(".header-inner-content").removeAttr("style");
        }
    }
}

function stm_motocycle_fixed_header() {
    if ($('.stm_motorcycle-header').hasClass('header-listing-fixed')) {
        var currentScrollPos = $(window).scrollTop();
        var headerPos = $('#header').offset().top;
        var $headerHeight = 0;
        if ($this.hasClass('listing-nontransparent-header')) { $('#header').css('min-height', $headerHeight = $this.outerHeight() + 'px'); }
        if (currentScrollPos > headerPos + 200) { $this.addClass('stm-fixed-invisible'); } else { $this.removeClass('stm-fixed-invisible'); }
        if (currentScrollPos > headerPos + 400) {
            $this.addClass('stm-fixed');
            $('#header').addClass('stm-header-was-fixed');
        } else {
            $this.removeClass('stm-fixed');
            $('#header').removeClass('stm-header-was-fixed');
        }
    }
};
